import React from 'react';
import './Users.css'; // Importa el archivo CSS para los estilos

function Users() {
  return (
    <div className="users-container">
      <div className="banner">ClonBuster: Usuarios</div>
      <div className="buttons-column">
        <button className="action-button">Crear</button>
        <button className="action-button">Leer</button>
        <button className="action-button">Actualizar</button>
        <button className="action-button">Borrar</button>
      </div>
    </div>
  );
}

export default Users;
